import Axios from "axios";
import React, { Component } from "react";

class ViewEventForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      //   eventname: "",
      //   description: "",
      //   eventtime: "",
      //   eventdate: "",
      //   location: "",
      //   eligibility: ""
      events: []
    };
    this.startfunc = this.startfunc.bind(this);
  }

  async startfunc() {
    //event.preventDefault();
    let email = localStorage.getItem("email");
    await Axios.post("http://127.0.0.1:4001/companyviewevent", {
      authemail: email
    })
      .then(data => {
        //console.log(data);
        this.setState({
          //   eventname: data.data.eventname,
          //   description: data.data.description,
          //   eventtime: data.data.eventtime,
          //   eventdate: data.data.eventdate,
          //   location: data.data.location,
          //   eligibility: data.data.eligibility
          events: data.data
        });
        console.log(this.state.events[0].eventname);
      })
      .catch(err => {
        console.log(err);
      });
  }

  componentDidMount() {
    this.startfunc();
    console.log("comp");
  }

  render() {
    const items = this.state.events.map(item => <li>{item}</li>);
    return (
      <div>
        <div className="Container">{this.state.events.events}</div>
        <ul>{items}</ul>
      </div>
    );
  }
}
export default ViewEventForm;
